import React, { useState } from 'react';
import { SearchBar } from './SearchBar';
import { LogoutButton } from './../pages/Logout/Logout';
import { AddArticleButton } from './../pages/AddArticle/AddArticle';
import { Grid, Header } from 'semantic-ui-react'

const Headers = () => {
  return (
    <Grid>
      <Grid.Row centered>
        <Header as='h1'>Blog App</Header>
      </Grid.Row>
      <Grid.Row centered>
        <SearchBar />
      </Grid.Row>
      <Grid.Row centered>
        <LogoutButton />
        <AddArticleButton />
      </Grid.Row>
    </Grid>
  );
}

export default Headers;
